script: |
  super -f text -I q1801.spq | sort > q1801.out

inputs:
  - name: q1801.spq
    data: |
      SELECT - - col2 AS col1 FROM tab1 (FORMAT parquet) WHERE col1 IS NOT NULL AND NOT 99 + - col0 * - 35 = - 43 - + col0 * col1;
  - name: tab1

outputs:
  - name: q1801.out
    data: |
      59
      68
      96
